import React from 'react';
import axios from 'axios';
import PropTypes from "prop-types";
import {
    Card,
    CardHeader,
    ListGroup,
    ListGroupItem,
    Row,
    Col,
    Form,
    FormGroup,
    FormInput,
    FormSelect,
    FormTextarea,
    Button
} from "shards-react";

import CanvasJSReact from './canvasjs.react';

const TaskChart = () => {
    return (
        <Card small className="mb-4">
            <div>TaskChart</div>
        </Card>
    );
};

export default TaskChart;
